.data-labels {
  font-size: 12px;
  text-anchor: middle;
  font-family: helvetica, arial, sans-serif;
  pointer-events: none;
}
.bsg-body {
  position: absolute;
  min-height: 50px;
}
.chordChart {
  font-family: helvetica, arial, sans-serif;
  font-size: 12px;
  position: absolute;
}
.chordChart path.chord {
  fill-opacity: 0.67;
  stroke: #000;
  stroke-width: 0.5px;
}
.chordChart polyline {
  stroke-width: 1px;
  fill: rgba(0, 0, 0, 0);
}
.chordChart .tick-text {
  pointer-events: none;
}
.d3-tip {
  position: absolute;
  opacity: 0;
  box-sizing: border-box;
  line-height: 1;
  font-weight: bold;
  padding: 12px;
  background: rgba(0, 0, 0, 0.8);
  border-radius: 2px;
  pointer-events: none;
  z-index: 5;
}
.freeText,
.freeText3 {
  position: absolute;
  font-size: 100px;
  color: #BEE3BE;
  transform: rotate(-45deg);
  opacity: 0.3;
}
.freeText2,
.freeText6 {
  opacity: 0.1;
  color: #000;
}
.freeText4,
.freeText5 {
  opacity: 0.3;
  color: #FFF;
}
.logo {
  width: 100px;
  height: 100px;
  background-image: url(data:image/png;charset=utf-8;base64,);
}


